import React from "react";

import Card from "../components/UiElements/Card";
import "./Home.css"

const Home = () => {
    return (
        <React.Fragment>
            <Card>
            <div class="container">
                <h1>home page works</h1>
            </div>
            </Card>
        </React.Fragment>
    );
} 

export default Home;
